import React from 'react';
import { Layout, Menu, Row, Header } from 'antd';

const Navbar = () => {
    return (
        <Layout.Header  className="layout">
            <Header>
                {/*<Row justify="end">*/}
                    <Menu theme="light" mode="horizontal" selectable={false}>
                        <Menu.Item key={1}>Логин</Menu.Item>
                    </Menu>
                {/*</Row>*/}
            </Header>
        </Layout.Header>
    );
};

export default Navbar;
